import { Component } from '@angular/core';
import { ApiService } from './path-al-tuo-servizio'; // Assicurati di importare il percorso corretto

@Component({
  selector: 'app-tuo-componente',
  templateUrl: './tuo-componente.component.html',
  styleUrls: ['./tuo-componente.component.css']
})
export class TuoComponente {
  constructor(private apiService: ApiService) {}

  cambiaLettera(lettera: string) {
    this.apiService.cambiaSearchByFURL(lettera); // Cambia l'URL nel servizio
    this.apiService.searchByF().subscribe((data) => {
      // Gestisci la risposta della chiamata API qui
    });
  }
}
